import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Home from '../Home';
import Header from '../elements/Header';

const App = () => {
  return (
    <>
      <Header />
      <Switch>
        <Route exact path='/' component={Home} />
      </Switch>
    </>
  );
};

export default App;
